  [],\n\t\"num_tags\": 0,\n\t\"name\": \"primary-productivity-nutrients-and-other-data-from-bottle-casts-from-the-noaa-ship-miller-freem\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Primary productivity, nutrients, and other
  data were collected from bottle casts from NOAA Ship MILLER FREEMAN from 12 November
  1975 to 26 November 1975. Data were collected by the University of Alaska - Fairbanks;
  Institute of Marine Science (UAK/IMS) as part of Outer Continental Shelf Environmental
  Assessment Program (OCSEAP). Data were processed by NODC to the NODC standard F029
  Primary Productivity format. Full format description is available from NODC at www.nodc.noaa.gov/General/NODC-Archive/f029.html.
  An analog file for this accession is available from NODC user services.nnThe F029
  format contains data from measurements of primary productivity. The data are collected
  to provide information on nutrient levels and nutrient flow in offshore areas. In
  addition to cruise information, position, date, time, sampling depths, bottom depth,
  and environmental information, this file may contain measured parameters including:
  concentrations of nutrients such as phosphate, nitrate, silicate, and ammonia; temperature
  and salinity; and carbon assimilation. Measurements of chlorophyll A, phaeopigment,
  and carbon assimilation may be reported as integrated values. A free-text record
  is available for comments.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
